import React from "react";
import Day from "./Day";
import PropTypes from 'prop-types';

class Forecast extends React.Component {
	constructor() {
		super();
		var items = undefined;
	}




  render() {
  	return (
  		<ul className="forecast">
  			{
  				this.props.days.map(({data, links, href}) => 
  					<li>
  						<Day dayname={data} />
						</li>
					)
  			}

			</ul>


  		)
	}
}

Forecast.propTypes = {
  days: PropTypes.array
};

export default Forecast;
